    In most cases, the best default is \'%s\'. You can also select \'%s\' to preserve the old behavior, or some other remote or branch. But you almost certainly want to select \'origin/master\'.
    (Technically: the merge-base of the selected revision and HEAD is used to determine the start of the commit range.)' => 'Vous exécutez une commande qui opère sur une plage de versions (d’habitude, d’une version quelconque à HEAD) mais vous n’avez pas spécifié la version qui détermine le début de la plage.
